// Codepen presentation
.container {
    margin-top: 4em;
    margin-bottom: 4em;
    padding: 0 ;
  }
.card_title{
  clip-path: inset(100%);
  clip: rect(1px, 1px, 1px, 1px);
  height: 1px;
  overflow: hidden;
  position: absolute;
  white-space: nowrap;
  width: 1px;
}
